import './App.css';

export const App = () => {
  return (
    <div className="App">
      <main className='taskManagerParent'></main>
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

export default App;
